import React from 'react';
import './App.css';


const App = () => {
  return (
    <div>
      <header>
        <img src='https://www.logoarena.com/market/public/13251/13251_1491491150_c3.jpg'/>
      </header>
      <nav>
      <div>Menu</div>
      </nav>

      <div>
        Main content
      </div>

    </div>
  );
}





export default App;
